import React, { Component } from "react";



import Noticias from './Noticias';
import FormLogin from './FormLogin';

class Login extends Component {
    render() {
        return (
            <div>
                <div className="container">
                    <div className="row">
                        <div className="col-12 col-md-8">
                            <Noticias></Noticias>
                        </div>
                        <div className="col-4">
                            <FormLogin></FormLogin>
                        </div>
                    </div>



                </div>


            </div>
        )
    };

}

export default Login;
